import "./App.css"
import axios from "axios"
import { useEffect} from "react"

const App = () => {
  const [countries, setCountries] = useState([])

  const getData = () =>
    axios
      .get("https://restcountries.com/v3.1/all")
      .then((response) => response.data)

  useEffect(() => {
    const data = getData()
    setCountries(data)
  }, [])

  return (
    <div>
      <ol>{countries.map((country) => `<li>${country.name.common}</li>`)}</ol>
    </div>
  )
}

export default App
